import './Profile.css';

const Profile = () => {
    return (
        <div className='profile'>
        <img className='cat' src='https://images.unsplash.com/photo-1611915387288-fd8d2f5f928b?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=1080&fit=max'></img>
       <div className='about'>
        <p>Name: Vlad</p>
        <p>Age: 16</p>
        <p>About me: I like sport so much
        2 years of tennis and 7 years of karate
        </p>
        <p>City: Kyiv, Ukraine</p>
        </div>
        </div>
    );
}

export default Profile;
